import React from 'react';

const Footer = ({ currentPage }) => {
  const sections = ['home', 'about', 'projects', 'contact', 'testing'];

  return (
    <div
      style={{
        display: "flex",
        justifyContent: "center",
        alignItems: "center",
        color: "white",
        gap: "10rem",
        marginTop: "50px",
      }}
    >
      <ul
        style={{
          display: 'flex',
          listStyleType: 'none',
          padding: 0,
          gap: '10rem',
          fontSize: '3px',
        }}
      >
        {sections.map((section, index) => (
          <li key={index}>
            <div
              className={section === currentPage ? 'dot__focused' : 'dot'}
            ></div>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default Footer;
